import React from "react";

export const Shopitem = () => {
  return (
    <section className="product-container">
      <div className="grid grid-cols-4 sm:grid-cols-2 lg:grid-cols-4">
        <div className="col-span-1 bg-gray-200 p-6">Column 1</div>
        <div className="col-span-1 bg-gray-300 p-6">Column 2</div>
        <div className="col-span-1 bg-gray-400 p-6">Column 3</div>
        <div className="col-span-1 bg-gray-500 p-6">Column 4</div>
      </div>
    </section>
  );
};
